import React from "react";
import { Greeting } from "../components/greeting/greeting";
import { Button } from "react-bootstrap";

function Home() {
  return (
    <div>
      <div className="w-100">
        <h1 xs={12} className="text-center mb-4">
          <Greeting />
        </h1>
        <Button>Add </Button>
      </div>
    </div>
  );
}

export default Home;
